import NavBar from "./NavBar";

export default function Dashboard ({ user, onLogin }) {

    return (
        <>
            <p>Dashboard lives here</p>
            <NavBar user={user} onLogin={onLogin} />
            <ProjectList user={user} />
        </>
    )
}
